postcontent:
Spike's Tactical 9.5" Pistol/SBR complete upper in 300 AAC Blackout (BLK). All parts are new and unfired. Some parts were loosely assembled for photographs only. You can take them unassembled (including the original factory packaging) or I can assemble them for you. I have all the proper tools, experience, etc. Parts consist of the following (including price I paid):

Spike's upper receiver ($150);
Spike's 10" BAR2 rail ($225);
Core15 9.5" barrel ($261.50);
Custom Muzzle Brake ($200);
Spike's M16 BCG ($130);
BCM Gunfighter Mod4 ($39.99);
YHM gas block w/set screws ($19.99);
Spike's melonited gas tube ($19.99);
Spike's ladder rail covers (free.99);
Spike's free float barrel nut (free.99).

The piéce de résistance is the wicked muzzle brake that was handcrafted for this upper (300 BLK) by Quake Brakes of Rockwall, TX. I paid $1,050. Asking $1,000. FTF in Dallas or Mesquite.
